(92824, 217217, 6523, 3, '發生過的', '', '2014-02-14 00:00:00', 2000, 20, 0, 7, '在開始與暫停的段落間\n如果我忘記了我是誰\n不要意外\n發生過的已將我改變\n\n在自由與迷途的幻影中\n無可言喻的孤獨\n像冬夜星斗\n披著白紗\n將我拒絕\n\n在光影交錯之間\n倒榻的城牆旁\n我默數自己的步伐\n在王與王子的永恆決鬥之中\n我是青蛙\n破肚穿腸\n等待你的禱告\n祝我復活\n\n在開始與暫停的段落間\n不見了安眠的魔法\n不要擔心\n發生過的會將我催眠\n\n在太陽消失之前\n夢與現實摩擦\n躲不了心底的掙扎\n\n在光影交錯之間\n倒榻的城牆旁\n我參與帝國的滅亡\n在王與王子的永恆誤解之中\n我是青蛙\n破肚穿腸\n只為聽你禱告\n祝我復活\n\nMihumisang\nMihumisang\n', '', 382, '', '', '', '', '你們你們', '', 1, 1, 0, '2014-11-27 19:17:19', '2015-03-12 14:17:17', '0000-00-00 00:00:00'),
(92825, 214646, 0, 1, 'FLY TO THE SKY', '', '2014-11-27 00:00:00', 2014, 19, 1, 1, '', 'FLY TO THE SKY\n詞/曲：艾兒頓\n編曲：DREAM 6\n\n逆著風大步向前  才明白夢有多美\n活得悲哀不如活得精采痛快  勇敢而燦爛\n\n放肆地大笑  灑脫  白日夢不再是夢\n用力揮霍  拋開所有心中枷鎖  讓自己感動\n\n當風雨  都過去  迎著風  飛向驕傲的天空\n\n我要星星為我而閃爍  地球因為而轉動  我的夢\n這一次下好離手不放過  就算失敗也要  瘋狂  執著  愛過\n\n緊握每一秒  綻放這微笑  I BELIEVE\n擁抱下一次  狂戀的勇氣  I WANNA FLY TO THE SKY \n\nOH...OH...OH...\nI WANNA FLY TO THE SKY\n\nOH...OH...OH...\nNEVER GIVE UP! NEVER GIVE UP! NEVER!\nNEVER GIVE UP! NEVER GIVE UP! NEVER!\n', 223, '', '', '', '', '夢想六號Dream6樂團', '', 0, 1, 0, '2014-11-27 21:51:08', '2015-03-12 14:17:17', '0000-00-00 00:00:00'),
