(92827, 217486, 8098, 4, 'Part of Me', '', '2014-12-19 00:00:00', 2000, 20, 0, 1, 'Part of me \n\nI still believe you’ll see \nThe very part of me\nI still believe you’ll see \nThe very part of me\nI still believe you’ll see \nThe very part of me\nI still believe you’ll be\nThe end of my destiny\nI still believe\nI still believe\nI still believe \nI still believe\n', '', 296, '', '', '', '', '亞神音樂AsiaMuse', '', 0, 1, 0, '2014-11-28 16:02:41', '2015-03-12 14:17:17', '0000-00-00 00:00:00'),
(92828, 156879, 0, 0, '問世間', '', '2014-11-28 00:00:00', 2000, 19, 0, 4, '《問世間》——神雕俠侶插曲\n\n作詞：元好問作曲：譚旋\n編曲：陳磊演唱：陳翔 \n\n問世間情是何物？\n直教生死相許。\n天南地北雙飛客，\n老翅幾回寒暑。\n\n歡樂趣，離別苦，\n就中更有癡兒女。\n君應有語，渺萬里層雲，\n千山暮雪，只影向誰去？\n', '', 251, '陳翔', '', '', '', '福茂唱片LINFAIR RECORDS', '', 0, 1, 1, '2014-11-28 16:28:54', '2014-12-17 17:30:38', '2014-12-17 17:30:38'),
