(92830, 226083, 8041, 1, 'Since 1983', 'Music Consulted by Hsuan-Chia Huang\nMusic Composed and Arranged by Neng-Hsin Wang\n\n1983正是Neng-Hsin Wang（NHW）的出生年份。「出生」，對信靠基督的NHW而言，當出生來到這世上，便是要開始面對體會世上相繼而來的罪及苦難！\n\n未正式踏上基督天家的道路前，NHW心中的擔憂便靠著　神的話語，來得以解放！「Since 1983」樂曲中，潛伏著不安、戰戰兢兢的旋律及節奏，為著警惕世人，儘管在世上眼前一片安逸無暇，但未進入基督天家的門之前，罪及苦難便不曾遠離自身過…', '2014-11-11 00:00:00', 2000, 15, 0, 16, '', '', 253, '', 'Neng-Hsin Wang', '', 'Neng-Hsin Wang and Hsuan-Chia Huang', 'Leaven Frame', '', 0, 1, 0, '2014-11-29 11:24:13', '2015-03-12 14:17:17', '0000-00-00 00:00:00'),
(92831, 226083, 8041, 2, 'Mak923', 'Music Composed and Arranged by Neng-Hsin Wang\n\n「Mak923」原意來自「Mark 9：23（馬可福音　九章23節）」的縮寫，也是作為新專輯的名稱！馬可福音　九章23節：「耶穌對他說、你若能信、在信的人、凡事都能。」經文中的「能信」，其實就是Neng-Hsin Wang（NHW）的中文名字，也是NHW為何要以「Mak923」作為新專輯名稱的最大原因！而此專輯是NHW透過音樂來敘述個人前段人生歷程的完整呈現方式，相當別具意義。\n\n「Mak923」充分展現出NHW在合成器樂及電子氛圍上的熟悉運用！融合電吉他的襯底，更巧妙編制出，柔和又帶有力量的無限意境！', '2014-11-11 00:00:00', 2000, 15, 0, 16, '', '', 340, '', 'Neng-Hsin Wang', '', 'Neng-Hsin Wang and Hsuan-Chia Huang', 'Leaven Frame', '', 0, 1, 0, '2014-11-29 11:57:03', '2015-03-12 14:17:17', '0000-00-00 00:00:00'),
(92832, 226083, 8041, 3, 'The Village', 'Music Composed and Arranged by Neng-Hsin Wang\n\n「Village」原意在此專輯中，代表著Neng-Hsin Wang（NHW）從小成長的眷村。\n\n眷村的概念對NHW而言，是沒有色彩的大型裝置。灰暗髒亂的環境、年邁毫無生氣的群體，由「The Village」透過大提琴及合成打擊器樂，勾勒出一頁頁的印象畫面。', '2014-11-11 00:00:00', 2000, 15, 0, 16, '', '', 216, '', 'Neng-Hsin Wang', '', 'Neng-Hsin Wang and Hsuan-Chia Huang', 'Leaven Frame', '', 0, 1, 0, '2014-11-29 14:47:55', '2015-03-12 14:17:17', '0000-00-00 00:00:00'),
(92833, 226083, 8041, 4, 'Game-Gang', 'Music Consulted by Hsuan-Chia Huang\nMusic Composed and Arranged by Neng-Hsin Wang\n\n「Game-Gang（遊戲幫）」採用率性的搖滾編制。高達235的Tempo，讓率性伴隨著速度感…', '2014-11-11 00:00:00', 2000, 15, 0, 16, '', '', 262, '', 'Neng-Hsin Wang', '', 'Neng-Hsin Wang and Hsuan-Chia Huang', 'Leaven Frame', '', 0, 1, 0, '2014-11-29 14:55:57', '2015-03-12 14:17:17', '0000-00-00 00:00:00'),
(92834, 226083, 8041, 5, 'Meet Christ', 'Music Inspired by Hsuan-Chia Huang\nMusic Composed and Arranged by Neng-Hsin Wang\n\n「Meet Christ」是呈現出Neng-Hsin Wang（NHW）接觸耶穌基督的當下情境！優美的管弦器樂更代表耶穌基督溫暖的懷抱。\n\n值得一提的是，「Meet Christ」是NHW認識未婚妻Hsuan-Chia Huang（HCH）時創作的作品，NHW更特別加入了HCH喜愛的雙簧管樂器！', '2014-11-11 00:00:00', 2000, 15, 0, 16, '', '', 281, '', 'Neng-Hsin Wang', '', 'Neng-Hsin Wang and Hsuan-Chia Huang', 'Leaven Frame', '', 0, 1, 0, '2014-11-29 15:00:04', '2015-03-12 14:17:17', '0000-00-00 00:00:00'),
(92835, 226083, 8041, 6, 'Inspiration!', 'Music Composed and Arranged by Neng-Hsin Wang\n\nNeng Hsin Wang（NHW）典型的氛圍風格作品。', '2014-11-11 00:00:00', 2000, 15, 0, 16, '', '', 365, '', 'Neng-Hsin Wang', '', 'Neng-Hsin Wang and Hsuan-Chia Huang', 'Leaven Frame', '', 0, 1, 0, '2014-11-29 15:06:25', '2015-03-12 14:17:17', '0000-00-00 00:00:00'),
(92836, 226083, 8041, 7, '"BABY SHERRY"', 'Music Inspired by Hsuan-Chia Huang\nMusic Composed and Arranged by Neng-Hsin Wang\n\n「"BABY SHERRY"」是Neng-Hsin Wang（NHW）特別為未婚妻Hsuan-Chia Huang（HCH）創作的樂曲！而"Sherry"正是HCH的英文名字。\n\n優雅的鋼琴配合古典管弦，將情感與呵護交織出一首浪漫樂章。NHW更是將傳統器樂發揮得淋漓盡致…這正是NHW對HCH的愛，表露無遺！', '2014-11-11 00:00:00', 2000, 19, 2, 16, '', '', 333, '', 'Neng-Hsin Wang', '', 'Neng-Hsin Wang and Hsuan-Chia Huang', 'Leaven Frame', '', 0, 1, 0, '2014-11-29 15:10:08', '2015-03-12 14:17:17', '0000-00-00 00:00:00'),
(92837, 303889, 0, 1, '靜', '', '2014-11-30 00:00:00', 2014, 19, 0, 6, '讓我心裡　一刻安睡 \n拭乾眼淚　愁腸偏愛醉 \n其實我　也想過問　加以著緊 \n\n問你心裡 可否安睡 \n可會太累 從來不覺對 \n然後我 卻哭抱罪 \n仿雪花　都粉碎 \n\n維港這夜停住了釋放 \n離去帶著沉默與失望 \n注意到教堂的聖詩 \n這聖誕已不再為慶祝可自個兒　為何哭了 \n平安晚夜情調已不再 \n完了卻是難受也失落 \n但悔疚改不寫結果 \n最尾也理解我是錯 \n我的心裡　只想安靜\n愁緒　都表裡相應 \n\n深宵以後　為何讓燈飾　照射花店角落玫麗沉寂 \n忘掉那份回憶\n懷愐過去也都沒法糾正\n\n維港這夜停住了釋放 \n離去帶著沉默與失望 \n注意到教堂的聖詩 \n這聖誕已不再為慶祝可自個兒　為何哭了 \n平安晚夜情調已不再 \n完了再別難受也失落 \n但悔疚改不寫結果 \n最尾也理解我是錯 \n我只需要　一刻安靜\n愁緒　都表裡相應', '', 243, '', 'Dann', 'Dann', 'Dann', 'Dann', '', 0, 1, 0, '2014-11-30 08:17:16', '2015-03-12 14:17:18', '0000-00-00 00:00:00'),
