(92844, 180459, 8028, 4, '我還想念你', '', '2014-12-19 00:00:00', 2000, 19, 0, 4, '我還想念你 詞 天才 曲 畢書盡、天才\n\nA1\n如果 如果 你是一片風景\n然後 然後 我這麼的愛你\n被當作 路過的感情\n\nA2\n不對 不對 我不會太著迷\n笨蛋 笨蛋 我是在騙自己\n把回憶 備份太多餘\n\nB\n太感人的舊電影 太悲傷的壞天氣\n我明明想忘記 全世界卻都在提醒\n\nC1\n我還想念你 像呼吸一樣 簡單的事情\n活著不能沒有你 我需要你的空氣\n\nC2\n我還想念你 像呼吸一樣 困難的水裡\n擁抱不住的身影 隨時間沈沒 \n一點一滴隱形  我還想念你 (還想念你)\n\n3C1\n想念你 簡單的事情\n活著不能沒有你 你就是我的空氣\n\n3C2\n想念你 我還想念你\n擁抱不住的身影 隨時間沈沒 \n一點一滴隱形  我還想念你\n', '', 238, '', '', '', '', '福茂唱片LINFAIR RECORDS', '', 0, 1, 0, '2014-12-01 12:02:40', '2015-03-12 14:17:18', '0000-00-00 00:00:00'),
